var clickOrTouchEvent = "click";

function configureCardPopup () {

  //$('head').append('<meta name="viewport" content="width=device-width" />');

  if(window.touch) clickOrTouchEvent = 'touchstart';

  // var d = new Date();
  // if((cardYear == d.getFullYear()) && (d.getMonth() == 11)){
  //   var pass = prompt('Just confirming you want to see this year\'s card ... What year is it?');
  //   if(pass != '2013'){ //('cde2013'+d.getDate())){
  //      alert('Sorry your answer was wrong! Hiding the card for your own protection! :)');
  //      return false;
  //   }
  // }

var urlKeyPresent = (document.location.search.toUpperCase().indexOf('TEST=1',0) > -1);

var d = new Date();
var currentYear = d.getFullYear();
var currentMonth = d.getMonth()+1;
var currentDay = d.getDate();

var showCard = true;
if(cardYear == currentYear && (currentMonth <= 12 && currentDay < 15) && !urlKeyPresent){
	alert('Sorry this card hasn\'t been shipped yet!');
	showCard = false;	
}else if(cardYear == currentYear && (currentMonth <= 12 && currentDay < 20) && !urlKeyPresent){
	// alert('Sorry this card hasn\'t been shipped yet!');
 //    return false;
	if (!confirm('Are you sure you want to view this year\'s new card?')) {             
		//if (!confirm('Are you sure you want to view this year\'s card?! \n\nHit [Cancel] and wait for Christmas if you don\'t want to spoil it!')) {             
	    	showCard = false;
	    //}  	
	// }else{
	// 	showCard = false;
	}

}


if(!showCard){
	$('body').html(""); // safeToOpen = false;
	return false;	
}

    

  if(cardYear){
    $('.card').html('<h1>Christmas Card <span id="spanCardYears"></span></h1><img src="' + cardImgURL + '" border=0/>' +
      '<div class="arrow arrow-right"></div><div class="arrow arrow-left"></div>');
    // $('.card').html('<h1>Christmas Card ' + cardYear + '</h1><img src="' + cardImgURL + '" border=0/>' +
    //   '<div class="arrow arrow-right"></div><div class="arrow arrow-left"></div>');    
  }

 
  // CE 20221216  
  if(cardNotes){
  	cardNotes = '<h1>About This Card</h1>' + cardNotes;
  	if(cardVerse) cardNotes = cardVerse + cardNotes; 
  	$('.card_details').html(cardNotes);
  } 

  var mediaHTML = "";
  if(mediaItems){
    var mediaData, nextTitle, nextThumb, nextURL, nextNotes,nextTitleWithNotes;
    for(var m=0;m<mediaItems.length;m++){
      mediaData = mediaItems[m].split(";");
      nextURL = mediaData[0];
      nextThumb = mediaData[1];
      nextTitle = mediaData[2];
      nextNotes = mediaData[3];
      
      if(nextTitle.indexOf('#break#',0) > 0){
      	nextTitle = nextTitle.replace('#break#','');      	
      	mediaHTML += '<br clear="all"/>';
      }      

      nextTitleWithNotes = nextTitle;
	  if(nextNotes != '' && nextNotes != null) nextTitleWithNotes += ': ' + nextNotes;

      mediaHTML += '<a class="colorbox related-thumb" rel="colorbox" ' +
                    ' href="' + nextURL + '" title="' + nextTitleWithNotes + '" style="background-image:url(' + nextThumb + ');">' +
                    '<label>' + nextTitle + '</label>' +
                    '</a>';
    }
  }
  if(mediaHTML != '') $('.card_media').append('<h1>Related Media:</h1>' + mediaHTML);

  $("a[rel='colorbox']").colorbox({
  	maxHeight:'95%'
  	 // maxWidth:'920px', maxHeight:'700px'
  	// innerWidth: "920px",
  	// innerHeight: "700px"
  });
// innerWidth: "900px",
// 		innerHeight: "504px",
// 		width: "900px",
// 		height: "504px",
// 		scalePhotos: true  


    if(cardYear > 1998){
      $('.card .arrow-left').bind(clickOrTouchEvent,function(){
        var previousCardPage = (cardYear-1) + '.htm';
        document.location.href = previousCardPage;
      });
    }else{
      $('.card .arrow-left').css('opacity','.3');
    }

    var now = new Date();
    var currentYear = now.getFullYear();
    if(cardYear < currentYear){
      $('.card .arrow-right').bind(clickOrTouchEvent,function(){
        var nextCardPage = (cardYear+1) + '.htm';
        document.location.href = nextCardPage;
      });
    }else{
      $('.card .arrow-right').css('opacity','.3');
    }

    $('body').append('<div class="card_comments"></div>');

    // DISQUS (only if not offline/local)
    // if(document.location.href.indexOf('file://',0) == -1){
    //   var disqus_shortname = 'ce-xmas-' + cardYear; // required: replace example with your forum shortname

    //   /* * * DON'T EDIT BELOW THIS LINE * * */
    //   (function() {
    //       var dsq = document.createElement('script'); dsq.type = 'text/javascript'; dsq.async = true;
    //       dsq.src = '//' + disqus_shortname + '.disqus.com/embed.js';
    //       (document.getElementsByTagName('head')[0] || document.getElementsByTagName('body')[0]).appendChild(dsq);
    //   })();

    //   var disqusHTML = '<h1>Comments:</h1><div id="disqus_thread"></div><noscript>Please enable JavaScript to view the <a href="http://disqus.com/?ref_noscript">comments powered by Disqus.</a></noscript><a href="http://disqus.com" class="dsq-brlink">comments powered by <span class="logo-disqus">Disqus</span></a>';
    //   $('.card_comments').append(disqusHTML);
    // }

	var d = new Date();
	var currentYear = d.getFullYear();

  $('<div class="card_footer"><a href="javascript:self.close();" class="button">close window</a>http://cards.chris-emerson.com' + 
  ' - All cards &copy;  <a href="mailto:email+cards@chris-emerson.com" target="_blank">Emerson Design</a> ' + currentYear + '</div>')
    .insertAfter('.card_comments');




}


$(document).ready(function () {
	try{

	$('body').addClass('card_page card_' + cardYear);

    configureCardPopup();


var flickrLinkCSS = $("<link>", { rel: "stylesheet",type: "text/css", href: "./css/flickr.css?v=20241213073534" });    
    $("head").append(flickrLinkCSS);    

    if(screen.height <= 600){
        setTimeout(function() {
            window.scrollTo(0, 1);
        }, 1500);
    }


	//$(".cboxElement").colorbox({iframe:true, innerWidth:1280, innerHeight:900});        
	var cardYearsDropDownHTML = "<select id='ddCardYears'>";
	var d = new Date();
	var currentYear = d.getFullYear();

	for(var y=1998;y<(currentYear+1);y++){
		var selectString = "";
		if(cardYear == y) selectString = " selected ";
		cardYearsDropDownHTML += '<option ' + selectString + ' value="' + y + '">' + y + '</option>';
	}
	cardYearsDropDownHTML += "</select>";
	$('#spanCardYears').append(cardYearsDropDownHTML);

 	$("#ddCardYears").change(function () {
 		document.location.href = this.value + '.htm';        
    });

    $('#ddCardYears').select2();

	}catch(e){
		console.log(e);
	}




});

